package main

import "fmt"

func d(s string, o interface{}) {
	fmt.Printf("%s: %+v\n", s, o)
}

func minOperations(nums []int, x int) int {
	L := len(nums)
	min := -1

	prefixSum := make([]int, L)
	s := 0
	for i := 0; i < L; i++ {
		s += nums[i]
		prefixSum[i] = s
	}
	y := prefixSum[L-1] - x
	if y < x {
		return -1
	}
	if y == x {
		return L
	}

	d("  nums", nums)
	d("prefix", prefixSum)

	best := 0
	i := -1
	j := 0
	l := 0
	for i < L-best && l <= x {
		for {
			if nums[j]-l < y {
				break
			}
			j++
		}
		if nums[j]-l == y {
			if j-i > best {
				best = j - i
			}
		}
		i++
		l = nums[i]
	}

	return min
}

